INSERT INTO `reading` (`id_reading`, `firstReading`, `psalms`, `id_language`) VALUES
(1, 'This is what Isaiah, son of Amoz,\nsaw concerning Judah and Jerusalem.\nIn days to come,\nthe mountain of the LORD’s house\nshall be established as the highest mountain\nand raised above the hills.\nAll nations shall stream toward it;\nmany peoples shall come and say:\n“Come, let us climb the LORD’s mountain,\nto the house of the God of Jacob,\nthat he may instruct us in his ways,\nand we may walk in his paths.”\nFor from Zion shall go forth instruction,\nand the word of the LORD from Jerusalem.\nHe shall judge between the nations,\nand impose terms on many peoples.\nThey shall beat their swords into plowshares\nand their spears into pruning hooks;\none nation shall not raise the sword against another,\nnor shall they train for war again.\nO house of Jacob, come,\nlet us walk in the light of the Lord!\n', 'R. Let us go rejoicing to the house of the Lord.\nI rejoiced because they said to me,\n“We will go up to the house of the LORD.”\nAnd now we have set foot\nwithin your gates, O Jerusalem.\nR. Let us go rejoicing to the house of the Lord.\nJerusalem, built as a city\nwith compact unity.\nTo it the tribes go up,\nthe tribes of the LORD.\nR. Let us go rejoicing to the house of the Lord.\nAccording to the decree for Israel,\nto give thanks to the name of the LORD.\nIn it are set up judgment seats,\nseats for the house of David.\nR. Let us go rejoicing to the house of the Lord.\nPray for the peace of Jerusalem!\nMay those who love you prosper!\nMay peace be within your walls,\nprosperity in your buildings.\nR. Let us go rejoicing to the house of the Lord.\nBecause of my brothers and friends\nI will say, “Peace be within you!”\nBecause of the house of the LORD, our God,\nI will pray for your good.\nR. Let us go rejoicing to the house of the Lord.', 1),
(2, 'KINUTLO GIKAN SA IKADUHANG BASAHON NI SAMUEL Unya gipadala sa GINOO si Natan Ngadto kang David. Miadto siya kaniya Ug giingnan niya si David, â€œMay duha Ka tawo nga miadto sa usa ka syudad, Dato ang usa og ang usa kabus. Daghan Kaayog mga hayopan ang dato, apan ang Kabus wala gayoy lain gawas sa usa ka Bayeng karnero nga iyang napalit. Ug Giamoma niya kini; mitubo kini uban Kaniya ug sa iyang anak, ug nagkan-anan Kini sa iyang mumho ug nag-imnanan sa Iyang imnanan. Iya kining kugoskugoson Sama sa iyang anak. Usa ka adlaw niana, may bisita nga Miabot sa balay sa dato, ug wala siyay Gusto nga mokuha gikan sa iyang Kahayopan aron iyang ihawon alang sa Bisita, ug maoy iyang giihaw ang baying Karnero sa kabus aron ikadalit niya sa Iyang bisita.â€ Unya nasuko pag-ayo si David, ug Giingnan niya si Natan, â€œIpanumpa ko Sa ngalan sa GINOO, nga ang tawo nga Nagbuhat niini angayng patyon. Kina- Hanglang ulian niya ang tag-iya ug upat Ka buok karnero kay wala siyay kaluoy.â€ Giingnan ni Natan si David, â€œIkaw Mao ang tawo. Ug niana ang pulong sa GINOO ,ang Dios sa Israel, â€˜Gidihogan Ko ikaw aron maghari sa Israel, ug Giluwas ko ikaw sa kamot ni Saul.â€ â€œBusa dili mo biya ang espada sa Imong balay, kay imo man akong gitamay, Og giilog mo ang asawa ni Uria.â€ Kini Ang giingon sa GINOO, â€˜Patunghaon ko Batok kanimo ang dautan gikan sa imong Banay; ug sa atubangan mo kuhaon ko Ang imong mga asawa ug ihatag ko sila sa imong silingan bisag adlawng dako. Imo kining gibuhat sa tago, apan buhaton Ko kini atobangan sa tibuok Israel ug sa Adlawng dako.â€ Miingon si David kang Natan, â€œNaka- Sala ako sa GINOO.â€ Ug giingnan ni Natan si David, â€œGipasaylo usab sa GINoo ang imong sala og dili ka niya Patyon. Apan kay pinaagi niining buhata Imo mang gipasipad-an ang GINOO, Mamatay ang bata nga natawo kanimo.â€ Unya mipauli si Natan sa ila. Gihatagan sa GINOO ug grabing Sakit ang anak ni David sa asawa ni Uria. Busa si David nagpakiluoy sa Dios tungod Sa bata; ug nagpuasa si David, ug mihigda Siya sa yuta tibuok gabii. Ang mga Kadagkoan miadto kaniya; apan midumili Siya, ug wala siya mokaon uban kanila. ANG PULONG SA GINOO. â€œSalamat sa Dios.â€', 'SALMO RESPONSORYO R. Linisa ang akong kasingkasing, O Dios Usa ka malinis nga kasingkasing Gamaa dinhi kanako, O Dios, Ug usa ka makanunayong espiritu Bag-oha sulod kanako. Ayaw ako isalikway sa imong atubangan, Ug ayaw kuhaa gikan kanako ang imong balaang espiritu. R. Linisa ang akong kasingkasing, O Dios Ibalik kanako ang kasadya sa imong Kaluwasan, Ug padayona dinhi kanako Ang mauyonong espiritu, Tudloan ko ang malapason sa imong Dalan Ug ang mga makasasala mamalik Kanimo. R. Linisa ang akong kasingkasing, O Dios Luwasa ako sa dugo nga makasasala, O Dios, akong manluluwas nga Dios; Unya Magsaysay ang akong dila sa Imong katarong. O Ginoo, abliha ang akong mga ngabil, Ug ang akong ba-ba magsangyaw Sa imong kadayganan. R. Linisa ang akong kasingkasing, O DiosSALMO RESPONSORYO R. Linisa ang akong kasingkasing, O Dios Usa ka malinis nga kasingkasing Gamaa dinhi kanako, O Dios, Ug usa ka makanunayong espiritu Bag-oha sulod kanako. Ayaw ako isalikway sa imong atubangan, Ug ayaw kuhaa gikan kanako ang imong balaang espiritu. R. Linisa ang akong kasingkasing, O Dios Ibalik kanako ang kasadya sa imong Kaluwasan, Ug padayona dinhi kanako Ang mauyonong espiritu, Tudloan ko ang malapason sa imong Dalan Ug ang mga makasasala mamalik Kanimo. R. Linisa ang akong kasingkasing, O Dios Luwasa ako sa dugo nga makasasala, O Dios, akong manluluwas nga Dios; Unya Magsaysay ang akong dila sa Imong katarong. O Ginoo, abliha ang akong mga ngabil, Ug ang akong ba-ba magsangyaw Sa imong kadayganan. R. Linisa ang akong kasingkasing, O DiosSALMO RESPONSORYO R. Linisa ang akong kasingkasing, O Dios Usa ka malinis nga kasingkasing Gamaa dinhi kanako, O Dios, Ug usa ka makanunayong espiritu Bag-oha sulod kanako. Ayaw ako isalikway sa imong atubangan, Ug ayaw kuhaa gikan kanako ang imong balaang espiritu. R. Linisa an